  state={
    filter:{
      PropertySize:'',
      photosAvailable:'',
      Rent:'',
    }
  }

    render() {

      return (
        <div className="row">
        <div className="col-12 col-lg-12 col-md-12 col-sm-12">
          <div className="card">

            <div className="row">
            <div className="col-6 col-lg-6 col-md-6 col-sm-6 text-align-l">
            <span>Filter</span> 
            </div>
            <div className="col-6 col-lg-6 col-md-6 col-sm-6 text-align-r">
